import React, { Component} from 'react';
import { Card, Row, Col, Form, Button} from 'react-bootstrap';

export default class Configuration extends Component {
    state = {
        configuration:[{ maxDeliveryTimeMinutes: 40, courierSpeedKmH: 20 }]
    }


    render(){
        return(
            <Card border="primary" className="m-5 mt-1 pt-3">
                <Card.Title className= "mx-auto"><h4> Configurations</h4> </Card.Title>
                <Card.Body>
                    <Row>
                        <Col>
                        <Form className="mx-auto">
                            <Form.Group as={Row} className="mb-1" controlId="formHorizontalNumber">
                                <Form.Label column sm={2}>Max delivery time minutes:</Form.Label>
                                <Col sm={2}>
                                    <Form.Control type="number" step="0.01" value={this.state.configuration.maxDeliveryTimeMinutes} onChange={this.handleLonChange} />
                                </Col>
                            </Form.Group>

                            <Form.Group as={Row} className="mb-1" controlId="formHorizontalNumber">
                                <Form.Label column sm={2}>Courier Speed in Km/H:</Form.Label>
                                <Col sm={2}>
                                    <Form.Control type="number" step="0.01" value={this.state.courierSpeedKmH} onChange={this.handleLonChange} />
                                </Col>
                            </Form.Group>
                        </Form>
                        </Col>
                    </Row>
                </Card.Body>
            </Card>
        );
    }
}
